import React from 'react';
import { Container } from './styled/Container.styled';
import { StyledHeader } from './styled/Header.styled';

const Header = () => {
    return (
        <>
            <StyledHeader>
                <Container>
                    <h1>Header</h1>
                </Container>
            </StyledHeader>
        </>
    );
};

export default Header;
